function About() {
   return (
      <section className='aboutContainer'>
         <Banner image={imgAboutBanner} texte="" />
         <div className='galeryCards'>
           <p>Page à propos contient une bannière et renseignements</p>
         </div>
      </section>
   )
 }
 
 export default About
